  return (
    <div className="full-container">
      <aside className="side-bar"></aside>
      <main className="main">
        <section className="hero">
          <div className="col2-1">
            <h2>Hi there, I'm</h2>
            <h1>Kushal Nandwani</h1>
            <h2>Front-End Web Developer</h2>
            <br />
            <br />
            <br />
            <p>
              I am a passionate web developer <br /> with a good taste of
              designing.
            </p>
          </div>
        </section>
      </main>
    </div>
  );
};

export default App;
